function Journies() {
  return (
    <div style={{paddingTop: '10vh', backgroundClip: 'content-box', width: '70vw', height: '70vh', backgroundColor: 'rgb(0,192,0)'}}></div>
  )
  // return <div style={{width: '25vw', display: 'flex', justifyContent: 'center'}}>
  //   <Session/>
  // </div>
}

function Session() {
  return (<div style={{display: 'flex', gap: '8px'}}>
    <p style={{color: 'rgb(0,192,0)'}}>+ $143</p>
    <p style={{color: 'rgb(40,40,40)'}}>&mdash;</p>
    <p style={{color: 'rgb(190,190,190)'}}>$1/$3 @ MGM</p>
    <p style={{color: 'rgb(40,40,40)'}}>&mdash;</p>
    <p style={{color: 'rgb(190,190,190)'}}>4.5 hrs</p>
  </div>)
}

export { Journies }
